// store.js
import { configureStore } from '@reduxjs/toolkit';
import verbsSlice from './verbsSlice';
import testSlice from './testSlice';

const store = configureStore({
  reducer: {
    verbs: verbsSlice,
    test: testSlice,
  },
});

export default store;
